import axios from "axios";

export const getCarouselAction = async (dispatch) => {
    try {
        const result = await Axios({
            url: 'http://movieapi.cyberlearn.vn/api/QuanLyPhim/LayDanhSachBanner',
            method: 'GET'
        });
        dispatch({
            type: 'SET_CAROUSEL',
            listBanner: result.content.data
        });
    } catch (error) {
        console.log(error);
    }
};
